import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import Emoji from "./Emoji";

const Card = (props) => {
    let text = "";
   let  x = ""
  return (
    <Aux>
      <div className="div1">
        <div className="div2">
          <h1>{props.head1}</h1>
        </div>
        <div className="div3">
            <Emoji emo = {emoji} txt = {text}/>
            <Emoji emo = {emoji} txt = {text} />
            <Emoji emo = {emoji} txt = {text}/>
            <Emoji emo = {emoji} txt = {text}/>
        </div>
      </div>
    </Aux>
  );
};

export default Card;
